import React from "react";

function Jumbotron() {
    return (
        <div className="jumbotron col-10 mx-auto mt-5">
            <h1 className="display-4">Hello, welcome to Google Book Search!</h1>
            <p className="lead">This app was built using react. Search for and save books of interest.</p>
        </div>
    );
}

export default Jumbotron;
